import { Link } from "react-router-dom";
import "./Card.css"

function Card({ id, name, status, species, gender, origin, image, onClose }) {
   return (
      <div class="todo">
         <button onClick={() => onClose(id)} class="click">X</button>
         
         <Link to={`/detail/${id}`} class="name">
         <h2>{name}</h2>
         </Link>
         
         <div class="text">
            <h2>{species}</h2>
            <h2>{gender}</h2>
            <h2>{status}</h2>
            <h2>{origin}</h2>
            <img src={image} alt='' />
         </div>
      </div>
   );
}

export default Card
